package flowcontrol;

import java.util.Scanner;

public class loops {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    
    Scanner s=new Scanner(System.in);
    int j=s.nextInt();
    do
    {
    	System.out.println(j);
    	j=j+1;
    	
    }
	while (j < 10);
	}

}
